import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function WelcomeScreen() {
  const navigate = useNavigate();

  return (
    <div className="sexy-bg relative min-h-screen w-full flex flex-col justify-between items-center text-[var(--color-gloss-white)] font-sans overflow-hidden">
      {/* Top Bar */}
      <div className="w-full flex justify-between items-start px-8 pt-8 text-base font-medium text-[var(--color-cool-gray)] z-10">
        <span>Careers (2)</span>
        <span>Get in touch</span>
      </div>

      {/* Centered Hero Content */}
      <div className="flex-1 flex flex-col items-center justify-center z-10">
        <div className="ares-hero-container">
          <div className="ares-boxed">ARES</div>
          <div className="ares-hero-trading">TRADING</div>
          <div className="ares-hero-exchange">EXCHANGE</div>
          <div className="ares-hero-tagline">MEME COIN DEFI EXCHANGE</div>
          <button
            className="ares-hero-btn-animated"
            onClick={() => navigate('/feed')}
          >
            ENTER
          </button>
        </div>
      </div>

      {/* Bottom Center */}
      <div className="w-full flex justify-center items-end pb-8 text-[var(--color-cool-gray)] text-base font-medium z-10">
        <span>Our Products</span>
      </div>
    </div>
  );
}
